 ) h1 ON m1.c_y=h1.c_y\r\nORDER BY m1.c_x DESC, m1.c_value DESC',NULL,'c_name','','c_value_m, c_value_h',NULL,NULL,1,'','',NULL,NULL,NULL,NULL,NULL,NULL,'','2014-03-24 14:03:26','super','2014-03-24 14:27:01'),('8a4aaed3-edd4-4515-9906-1a9439230666','test','测试报表',NULL,NULL,'6','chart_grid',NULL,NULL,'','BAR3D','Horizontal','SELECT c_x, c_y, c_value, c_labelx, c_labely FROM (( SELECT  \"m\" c_x, d.c_name c_y, COUNT(0) c_value, \"部署模块\" c_labelx, d.c_name c_labely FROM t_project_module m INNER JOIN t_dict_module d ON d.c_id = m.c_module_id INNER JOIN t_customer c ON m.c_customer_id = c.c_id WHERE 1 = 1 GROUP BY d.c_id ) UNION ALL ( SELECT \"h\" c_x, d.c_name c_y, COUNT(0), \"热点模块\", d.c_name c_module_name FROM t_project_module_hot m INNER JOIN t_dict_module d ON d.c_id = m.c_module_id INNER JOIN t_customer c ON m.c_customer_id = c.c_id WHERE 1 = 1 GROUP BY d.c_id )) mm ORDER BY mm.c_x DESC, c_value DESC',NULL,NULL,NULL,NULL,NULL,NULL,1,'','',NULL,NULL,NULL,NULL,NULL,NULL,'','2014-03-07 00:00:00','super','2014-03-07 11:14:27'),('967f6ece-0af6-4582-a199-60eaf558689d','projectState','项目状态',NULL,NULL,'6','chart_grid',NULL,NULL,'','PIE3D','Horizontal','SELECT c_state_group ,c_number_count,c_number_sum,c_number_avg FROM (SELECT IFNULL(s.c_name, \'未知\') c_state_group, count(0) c_number_count, count(0) * 1960 c_number_sum, count(0) / 10 c_number_avg FROM t_project p INNER JOIN t_customer c ON c.c_id = p.c_customer_id LEFT JOIN t_dict_state s ON p.c_state = s.c_id WHERE 1 = 1 GROUP BY s.c_id \r\n\r\nUNION ALL SELECT  \'售后\',100,390,990 from dual\r\n\r\nUNION ALL SELECT  \'售后\',20,290,290 from dual) t ORDER BY c_state_group',NULL,'c_state_group',NULL,'c_number_count',NULL,0,1,'','',NULL,NULL,NULL,NULL,NULL,NULL,'','2014-03-06 00:00:00','super','2014-03-12 20:16:53'),('b1958589-7a55-49ad-8d1b-aaf3bc04654e','customer_2c','客户列表.2层列头','客户列表.2层列头','','6','grid',NULL,NULL,'',NULL,NULL,'SELECT c.c_code, c.c_short_name, c.c_region1, c.c_region2, c.c_region3, c.c_industry1, c.c_industry2